import React, { useEffect, useState } from "react";

export default function FileHistoryLog() {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const stored = JSON.parse(localStorage.getItem("history") || "[]");
    setHistory(stored.reverse());
  }, []);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold text-gray-800 mb-4">File Upload History</h2>
      <div className="bg-white shadow-md rounded-lg p-4">
        {history.length === 0 ? (
          <p className="text-gray-500">No uploads yet.</p>
        ) : (
          <table className="w-full text-left">
            <thead className="bg-gray-100">
              <tr>
                <th className="py-2 px-4">File Name</th>
                <th className="py-2 px-4">Folder</th>
                <th className="py-2 px-4">Date Uploaded</th>
              </tr>
            </thead>
            <tbody>
              {history.map((item) => (
                <tr key={item.id} className="border-t hover:bg-blue-50">
                  <td className="py-2 px-4">{item.fileName}</td>
                  <td className="py-2 px-4">{item.folder}</td>
                  <td className="py-2 px-4">{item.date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
